scriptlet.script:
//This scriptlet is for Multi-Instance step migration!
//It will merge the Global Contexts of each child Multi-instance branch with the current flow global context
global_names = scriptletBranchContext.getGlobalVarNames();
var curName;
var curVal;
for(var i in global_names){
curName = global_names[i];
curVal = scriptletBranchContext.get(curName);
scriptletContext.putGlobal(curName,curVal);
}

keyName = keyName;
myValue = myValue;

scriptletContext.putGlobal(keyName, myValue);
